import React from 'react'
import { Nav } from '../Componets/Navbar/Nav'
import { Footer } from '../Componets/Footer/Footer'
import { Cervices } from '../Componets/Services/Cervices'
import { WhoCard } from '../Componets/Cards/WhoCard'

export const Who = () => {
  return (
    <div><Nav></Nav>
    <Cervices></Cervices>
    <WhoCard></WhoCard>
    <Footer></Footer></div>
  )
}
